import React from 'react';



function Change() {

    let img = {};
    let curDate = new Date();
    curDate = curDate.getHours();



    if (curDate >= 1 && curDate < 12) {

        img= "https://thecinemaholic.com/wp-content/uploads/2020/01/sabrina-15.jpg"

    } else if (curDate >= 12 && curDate < 19) {

        img = "Hellow";
    } else {

        img = "better";
    }


    return (

        <React.Fragment>
            {img}
        </React.Fragment>
        
        
        );

}

export default Change;
